        dispatch(Moins())}

     const reset = ()=>{
        dispatch(Reset())}

return (
    <div>

        <h1>{value}</h1>
        <button onClick={()=>incriment()}>Plus</button>
        <button onClick={decriment}>Moins</button>
        <button onClick={reset}>Fasa5</button>

    </div>
)



}
